# # Robot Kinematics
# 
# This lab will help you to visualize and think about vector spaces in the context of robotics. Think about your arm, starting from the shoulder, going down to your elbow and eventually your hand. The movement of your shoulder and elbow is directly related to the movement of your hand (assuming your wrist is rigid). Let's specify some quantities in the figure of the robot arm below.

# ![RR_arm.png](data:image/png;base64,)
# 
# The base $(0,0)$ of the arm above can be thought of as the "shoulder", and its angle from the horizontal is denoted $\theta_1$. The "elbow" is a distance $l_1$ away from the base, and its angle from the horizontal is denoted $\theta_2$. Finally, the end-effector or "hand" is located a distance of $l_2$ away from the elbow, and we denote its position as $(x,y)$.

# ## Visualization
# 
# The following code computes the kinematics for the arm, assuming $l_1 = l_2 = 1$. Given the angles $\theta_1$ and $\theta_2$, a figure is drawn showing what the entirety of the arm looks like. The two joints are shown as dots, the two links as line segments, and the end effector as a X. As usual, the angles are provided in radians and treated as modulo $2\pi$. Try showing different combinations of joint angles to get a sense for the configurations the arm can be in.

# In[1]:


import numpy as np
import matplotlib.pyplot as plt

l1 = 1
l2 = 1

def RR_position(th):
  return np.array([[l1*np.cos(th[0]) + l2*np.cos(th[1])],
                   [l1*np.sin(th[0]) + l2*np.sin(th[1])]])
  
def draw_RR(th):
  plt.plot([0, l1*np.cos(th[0]), l1*np.cos(th[0]) + l2*np.cos(th[1])],
           [0, l1*np.sin(th[0]), l1*np.sin(th[0]) + l2*np.sin(th[1])])
  plt.scatter([0, l1*np.cos(th[0])], [0, l1*np.sin(th[0])], zorder=3, s=50)
  plt.scatter([l1*np.cos(th[0]) + l2*np.cos(th[1])], 
              [l1*np.sin(th[0]) + l2*np.sin(th[1])], 
              marker='X', zorder=3, s=100)
  plt.grid()
  plt.axis('scaled')
  plt.xlim([-2.5,2.5])
  plt.ylim([-2.5,2.5])


# In[2]:


theta = np.array([0.6, 2.0])
draw_RR(theta)


# ## Jacobian Matrix
# 
# It can be shown through geometry and calculus that there is a *linear* mapping between the angular velocities of the shoulder and elbow $(\omega_1, \omega_2)$ and the translational velocities of the hand $(v_x, v_y)$. This mapping is given by the **Jacobian** matrix and looks like the following:
# 
# $$ \begin{bmatrix} v_x \\ v_y \end{bmatrix} = J(\theta_1, \theta_2) \begin{bmatrix} \omega_1 \\ \omega_2 \end{bmatrix} = \begin{bmatrix} -l_1 \sin\theta_1 & -l_2 \sin\theta_2 \\ l_1 \cos\theta_1 & l_2 \cos\theta_2 \end{bmatrix} \begin{bmatrix} \omega_1 \\ \omega_2 \end{bmatrix}$$
# 
# As you can see, the Jacobian implements a linear function that maps from $\mathbb R^2$ to $\mathbb R^2$ (to be precise, the domain and codomain are [tangent spaces](https://en.wikipedia.org/wiki/Tangent_space) of [$\mathbb T^2$](https://en.wikipedia.org/wiki/Torus) and $\mathbb R^2$, but they can be pretty much be treated as $\mathbb R^2$).
# 
# Note that this matrix depends on $\theta_1$ and $\theta_2$. As the arm's configuration changes, the nature of the function mapping will change as well. The following code include a function that computes and returns the Jacobian matrix for given values of $\theta_1$ and $\theta_2$, as well as a function to display the velocities $(v_x,v_y)$ as a vector at the end effector, given joint velocities $(\omega_1, \omega_2)$.

# In[3]:


def RR_jacobian(th):
  return np.array([[-l1*np.sin(th[0]), -l2*np.sin(th[1])],
                   [l1*np.cos(th[0]), l2*np.cos(th[1])]])
  
def draw_RR_velocity(theta, omega):
  EE = RR_position(theta)
  J = RR_jacobian(theta)
  v = J @ omega
  print('J =', J)
  print('v = ', v)  
  draw_RR(theta)
  plt.arrow(EE[0,0], EE[1,0], v[0], v[1], head_width=0.2, head_length=0.2)


# In[4]:


theta = np.array([0.6, 2.0])
omega = np.array([1,1])
draw_RR_velocity(theta, omega)


